import React from 'react';
import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, SafeAreaView, ScrollView } from 'react-native';

export default function App() {
  return (
    <SafeAreaView style={styles.container}>
      <ScrollView contentContainerStyle={styles.scrollContainer}>
        <View style={styles.header}>
          <View style={styles.logo}>
            <Text style={styles.logoText}>IT</Text>
          </View>
          <Text style={styles.title}>ITSM Mobile</Text>
          <Text style={styles.subtitle}>IT Service Management System</Text>
        </View>

        <View style={styles.content}>
          <Text style={styles.statusTitle}>ðŸš€ Development Server Running</Text>
          <Text style={styles.statusText}>
            React Native Expo app is now running on port 5000
          </Text>

          <View style={styles.featuresSection}>
            <Text style={styles.sectionTitle}>Planned Features:</Text>
            <View style={styles.featureList}>
              <Text style={styles.featureItem}>âœ“ Role-based Authentication (Admin/Agent)</Text>
              <Text style={styles.featureItem}>âœ“ Ticket Management System</Text>
              <Text style={styles.featureItem}>âœ“ All Tickets & My Tickets Views</Text>
              <Text style={styles.featureItem}>âœ“ Create Ticket Form</Text>
              <Text style={styles.featureItem}>âœ“ Ticket Details with Comments</Text>
              <Text style={styles.featureItem}>âœ“ File Upload Support</Text>
              <Text style={styles.featureItem}>âœ“ Supabase Database Integration</Text>
              <Text style={styles.featureItem}>âœ“ Category & Priority Management</Text>
            </View>
          </View>

          <View style={styles.configSection}>
            <Text style={styles.sectionTitle}>Configuration Status:</Text>
            <Text style={styles.configItem}>â€¢ Database: Supabase PostgreSQL âœ“</Text>
            <Text style={styles.configItem}>â€¢ Environment: Development âœ“</Text>
            <Text style={styles.configItem}>â€¢ Platform: React Native Expo âœ“</Text>
            <Text style={styles.configItem}>â€¢ Port: 5000 âœ“</Text>
          </View>
        </View>

        <StatusBar style="auto" />
      </ScrollView>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f5f7fa',
  },
  scrollContainer: {
    flexGrow: 1,
    padding: 20,
  },
  header: {
    alignItems: 'center',
    marginBottom: 30,
    paddingTop: 20,
  },
  logo: {
    width: 80,
    height: 80,
    backgroundColor: '#4CAF50',
    borderRadius: 40,
    justifyContent: 'center',
    alignItems: 'center',
    marginBottom: 15,
  },
  logoText: {
    color: 'white',
    fontSize: 32,
    fontWeight: 'bold',
  },
  title: {
    fontSize: 28,
    fontWeight: 'bold',
    color: '#333',
    marginBottom: 5,
  },
  subtitle: {
    fontSize: 16,
    color: '#666',
    textAlign: 'center',
  },
  content: {
    backgroundColor: 'white',
    borderRadius: 12,
    padding: 20,
    shadowColor: '#000',
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.1,
    shadowRadius: 3.84,
    elevation: 5,
  },
  statusTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    color: '#4CAF50',
    marginBottom: 10,
    textAlign: 'center',
  },
  statusText: {
    fontSize: 16,
    color: '#333',
    textAlign: 'center',
    marginBottom: 25,
  },
  featuresSection: {
    marginBottom: 25,
  },
  configSection: {
    backgroundColor: '#f8f9fa',
    padding: 15,
    borderRadius: 8,
    borderLeftWidth: 4,
    borderLeftColor: '#4CAF50',
  },
  sectionTitle: {
    fontSize: 18,
    fontWeight: 'bold',
    color: '#333',
    marginBottom: 15,
  },
  featureList: {
    paddingLeft: 10,
  },
  featureItem: {
    fontSize: 14,
    color: '#555',
    marginBottom: 8,
    lineHeight: 20,
  },
  configItem: {
    fontSize: 14,
